summary:
Hi, I am Sabina 👋 My expertise lies in business development and product go-to-market for tech industries as EdTech, Web3, AdTech, Social Tech, with focus on Europe and North America. 

I have 6+ years of experience in: 
→ business & strategic partnership development;
→ public speaking & pitching;
→ idea to MVP and go-to-market strategies;
→ managing product development & launch;
→ personal branding & brand identity.

Kicked off my own startup journey at 17 while studying and working, through out the time had a chance to work on building: digital creative agency, a sci-fi mobile game, social tech mobile app, mindfulness card game and many other things.

A big part of my work in tech & Web3 is advocating and promoting the idea of women + diversity in the space - through speaking opportunities, education and mentoring.

My superpower = business & tech skills combo, turning vision to reality + lifelong learning attitude.

-
My engagements, views, and posts are my own and do not reflect the opinions of my current, past, or future employers.

